import React, {Component} from 'react';
import { makeStyles } from '@material-ui/styles';
import { Grid, Hidden, Container, Card } from '@material-ui/core';
import windowSize from 'react-window-size';
import {
  Budget,
  TotalUsers,
  TasksProgress,
  TotalProfit,
  LatestSales,
  UsersByDevice,
  LatestProducts,
  LatestOrders,
  Filter,
  PropertyList,
  MapContainer,
  PropertyHeader,
  Amenities,
  FloorPlans
} from './components';
import './Property.css';

makeStyles(theme => ({
  root: {
    padding: theme.spacing(0), maxWidth: 800, 
  }
}));

const isDesktop = 0;
class Property extends Component {
  render(){
    console.log('props: ', this.props)
    if(isDesktop == 0){
      return (
        <div Container>
          <PropertyHeader></PropertyHeader>
            <div style={{display:'flex', justifyContent:'center', width: '100%', padding:30}}>
              <div>
                <Amenities style={{marginBottom:30, position:"sticky", position: '-webkit-sticky', top: 0}}></Amenities>
                <FloorPlans/>
              </div>
              <Amenities style={{position:"sticky", position: '-webkit-sticky', top: 0}}></Amenities>
            </div>
        </div>

      );
    } else {
        return(
            <div></div>
        );
    }
  };
  }

export default windowSize(Property);
